import React from 'react';
import yellowedBook from './yellowedBook.jpg';
import 'tachyons';

const TabOneContent = () => {
  return (
  	<div className='container'>
  		<div className='content-left'>
	  		<h1>Funded by readers like you. For readers like you.</h1>
	  		<p>This digital library is funded entirely by the people who use it.</p>
	  		<a className='btn'>Become a supporter</a>
  		</div>
  		<div className='content-right'>
  			<img src={yellowedBook} alt='yellowed book' width="500" height='600' />
  		</div>
  	</div>
  )
}

export default TabOneContent;
